import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import store from './store'
import { ProvideAuth } from './use-auth'

ReactDOM.render(
  <React.StrictMode>
    <ProvideAuth>
      <App />
    </ProvideAuth>
  </React.StrictMode>,
  document.getElementById('root')
);
